function I = fcnK1B(S, T, u, alpha, F, tol)
t2 = F .^ 2;t6 = F .* T;t8 = sqrt(t2 .* S + t6 + u);t9 = 0.1e1 ./ t8;t12 = u .^ 2;t13 = 0.1e1 ./ t12;t14 = t13 .* T;t15 = 0.1e1 ./ F;t19 = T .^ 2;t20 = t12 .* u;t21 = 0.1e1 ./ t20;t30 = 0.1e1 ./ (0.4e1 .* S .* u - t19);t36 = t19 .^ 2;t38 = t9 .* t30;t41 = sqrt(u);t50 = log(t15 .* (0.2e1 .* t8 .* t41 + t6 + 0.2e1 .* u));t53 = S .^ 2;t71 = -t9 ./ t2 ./ u ./ 0.2e1 + 0.5e1 ./ 0.4e1 .* t9 .* t15 .* t14 + 0.15e2 ./ 0.8e1 .* t9 .* t21 .* t19 - 0.15e2 ./ 0.4e1 .* F .* S .* t9 .* t30 .* t21 .* t19 .* T - 0.15e2 ./ 0.8e1 .* t38 .* t21 .* t36 - 0.15e2 ./ 0.8e1 .* t50 ./ t41 ./ t20 .* t19 + 0.13e2 .* F .* t38 .* t53 .* t14 + 0.13e2 ./ 0.2e1 .* t9 .* t30 .* S .* t13 .* t19 - 0.3e1 ./ 0.2e1 .* t9 .* t13 .* S + 0.3e1 ./ 0.2e1 .* t50 ./ t41 ./ t12 .* S;
I = t71(:,:,2) - t71(:,:,1);

end
